import './ExpenseItem.css';
function Date(props){
    const month = props.date.toLocaleString('en-US', {month: 'long'});
    const year = props.date.toLocaleString('en-US', {year: '2-digit'});
    const day = props.date.getFullYear();
    return (
        <div>
        <div>{month}</div>
        <div>{year}</div>
        <div>{day}</div>
        </div>
    );

}
export default Date;
